import './App.css';
import CircleProgress from './components/circle_progress/CircleProgress';
import Slider from "./components/slider/Slider"

function App() {
  return (
    <>
          <Slider
      min={0}
      max={99}
      onChange={({ min, max }) => console.log(`min = ${min}, max = ${max}`)}
    />
    <CircleProgress/>
    </>
  );
}

export default App;
